const initialState = {
  1215515: {
    meetings: 2,
    feeling: 50,
    moods: ['tired', 'happy', 'sad'],
    suggestions: [''],
  },
  Date: {
    meetings: 2,
    feeling: 50,
    moods: [],
    suggestions: [],
  },

}

const historicalDataReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
}

export default historicalDataReducer;
